long long readIntFromBufferAndAdvance(char *& InBuf)
{
  long long noRead=0;
  bool sign=false;
  for(;*InBuf==' ' || *InBuf=='\n' || *InBuf == '\0' || *InBuf == '\r';++InBuf);
  if(*InBuf == '-')
    {
      sign=true;
      InBuf++;
    }
  for(;*InBuf!=' ' && *InBuf!='\n' && *InBuf != '\0' && *InBuf != '\r';++InBuf)
    {
      noRead = noRead * 10 + (*InBuf - '0');
    }
  if(sign)
    {
      noRead*=-1;
    }
  InBuf++;
  return noRead;
};
 
int searchInPrimeArray(int Level,int n)
{
  int *arr, arrSize;
  switch(Level)
    {
    case 1:
      arr=Level1;
      arrSize=arrSize1;
      break;
    case 2:
      arr=Level2;
      arrSize=arrSize2;
      break;
    case 3:
      arr=Level3;
      arrSize=arrSize3;
      break;
    case 4:
      arr=Level4;
      arrSize=arrSize4;
      break;
    case 5:
      arr=Level5;
      arrSize=arrSize5;
      break;
    }
  int start=0,end=arrSize-1;
  while(start < end)
    {
      int middle=(start + end)/2;
      if (arr[middle] == n)
	{
	  return middle;
	}
      if(arr[middle] < n)
	{
	  start=middle+1;
	}
      else
	{
	  end=middle;
	}
    }
  return end;
};
 
